Patch Set 1:

@Ajaya: API v2 uses schema for basic validation. If it would be binded already to request deserializer only 1 extra line for v2 would be added to close the issue. So we don't need any additional module for validating data in the API for now.

When it comes to API v1 - well, we do not provide any new features there, and only bug-fixes. Personally, I will be the happiest man in the world when we drop support for it :)
